## Summary

- Add optional `params` field to `AgentConfig` type for per-agent stream param overrides
- Extend `resolveExtraParams()` to look up agent-specific params from `agents.list[].params` and merge them over global model defaults
- Pass `sessionAgentId` through to `applyExtraParamsToAgent()` in `attempt.ts`

This lets individual agents override cacheRetention (or other stream params) without affecting other agents. Useful for disabling caching on low-traffic agents like cron jobs where cache writes ($1.25/MTok) expire before reuse.

**Config example:**
```json
{
  "agents": {
    "list": [{
      "id": "risk-reviewer",
      "params": { "cacheRetention": "none" }
    }]
  }
}
```

Fixes #17112

## Test plan

- [x] Added test: per-agent params returned when agentId matches
- [x] Added test: agent params merge over global model defaults (agent wins)
- [x] Added test: unmatched agentId returns undefined (no side effects)

